import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import PostComponent from './PostComponent'; // Ensure this path is correct
import './Forum.css';
// ... Import your assets

function Forum() {
  const [posts, setPosts] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    axios.get('http://localhost:3001/api/forum/posts')
      .then(response => {
        setPosts(response.data);
      })
      .catch(error => console.error('Error fetching posts:', error));
  }, []);

  // Define any additional handlers or functionality as needed

  return (
    <div className="Forum">
      {/* Add any other sections or navigation handlers you need here */}
      
      {/* This section will display each post using the PostComponent */}
      {posts.map((post) => (
        <PostComponent key={post._id} post={post} />
      ))}

      {/* Add any other sections or content you need here */}
    </div>
  );
}

export default Forum;
